import React from "react";
import {
    useReactTable,
    getCoreRowModel,
    flexRender,
    getPaginationRowModel,
    getSortedRowModel,
    getFilteredRowModel,
  } from "@tanstack/react-table";

import { useState, useEffect } from "react";    
import Axios from "axios";
import '../../styleesheets/Dashboard.css';
import data from '../data.json'
import dayjs from "dayjs";

function ListadoTrabajosDashBoard(){

    const columns = [
        {
          header: "ID",
          accessorKey: "id",
          footer: "Mi ID",
        },
        // {
        //     header: 'Nombres y Apellidos',
        //    accessorFn: row => `${row.name} ${row.lastname}`
        // },
        {
          header: "Nombres Completos",
          columns: [
            {
              header: "Nombres",
              accessorKey: "name",
              footer: "Mi nombre",
            },
            {
              header: "Apellido",
              accessorKey: "lastname",
              footer: "Mi apellido",
            },
          ],
        },
        {
          header: "Email",
          accessorKey: "email",
          footer: "Mi email",
        },
        {
          header: "Country",
          accessorKey: "country",
          footer: "Mi pais",
        },
        {
          header: "Fecha de nacimiento",
          accessorKey: "dayOfBirth",
          footer: "Mi fecha de nacimiento",
          cell: (info) => dayjs(info.getValue()).format("DD/MM/YYYY"),
        },
      ];
    const [sorting, setSorting] = useState([]);
    const [filtering, setFiltering] = useState("");
  
    const table = useReactTable({
      data,
      columns,
      getCoreRowModel: getCoreRowModel(),
      getPaginationRowModel: getPaginationRowModel(),
      getSortedRowModel: getSortedRowModel(),
      getFilteredRowModel: getFilteredRowModel(),
      state: {
        sorting,
        globalFilter: filtering,
      },
      onSortingChange: setSorting,
      onGlobalFilterChange: setFiltering,
    });
  
    return (
      <div>
        <input
          type="text"
          value={filtering}
          onChange={(e) => setFiltering(e.target.value)}
        />
  
        <table>
          <thead>
            {table.getHeaderGroups().map((headerGroup) => (
              <tr key={headerGroup.id}>
                {headerGroup.headers.map((header) => (
                  <th
                    key={header.id}
                    onClick={header.column.getToggleSortingHandler()}
                  >
                    {header.isPlaceholder ? null : (
                      <div>
                        {flexRender(
                          header.column.columnDef.header,
                          header.getContext()
                        )}
  
                        {
                          { asc: "⬆️", desc: "⬇️" }[
                            header.column.getIsSorted() ?? null
                          ]
                        }
                      </div>
                    )}
                  </th>
                ))}
              </tr>
            ))}
          </thead>
          <tbody>
            {table.getRowModel().rows.map((row) => (
              <tr key={row.id}>
                {row.getVisibleCells().map((cell) => (
                  <td>
                    {flexRender(cell.column.columnDef.cell, cell.getContext())}
                  </td>
                ))}
              </tr>
            ))}
          </tbody>
          <tfoot>
            {table.getFooterGroups().map((footerGroup) => (
              <tr key={footerGroup.id}>
                {footerGroup.headers.map((footer) => (
                  <th key={footer.id}>
                    {flexRender(
                      footer.column.columnDef.footer,
                      footer.getContext()
                    )}
                  </th>
                ))}
              </tr>
            ))}
          </tfoot>
        </table>
  
        <button onClick={() => table.setPageIndex(0)}>Primer Pagina</button>
        <button onClick={() => table.previousPage()}>Pagina Anterior</button>
        <button onClick={() => table.nextPage()}>Pagina Siguiente</button>
        <button onClick={() => table.setPageIndex(table.getPageCount() - 1)}>
          Ultima Pagina
        </button>
      </div>
    );
  }
export default ListadoTrabajosDashBoard
